column8:
名水百選　安曇野わさび田湧水群<br>
信州安曇野は、名水百選に選定された水の郷。<br>
北アルプスに降った雪が白花崗岩に磨かれ、自然のミネラルと<br>
甘みをたっぷり含んだ天然水となって安曇野の地に悠々と湧き出しています。<br>
長野県・安曇野は、北アルプスに源を発する河川が形成した美しい扇状地です。<br>
扇状地の末端では酸素を豊富に含んだ良質な湧き水が湧き、<br>
安曇野ではこれを利用したわさび栽培が盛んに行なわれてきました。<br>
豊富な水量に加え水温が低いので、水耕栽培にも適した水です。<br>
北アルプスの花崗岩と、安曇野の豊かな自然がつくった水は、<br>
植物にも野生動物にも、もちろん人間にとっても、やさしくておいしい水なのです。<br><br>


・非加熱だから甘くて、美味しい<br>
100%天然の高品質な水だから、<br>
加熱処理をせずに2種類のミクロフィルターで濾過し、<br>
直接ボトリング。<br>
水に溶け込んでいるミネラル成分や酸素など、<br>
水を美味しくする成分を損なわず、<br>
自然がもつ本来の風味をそのままお届けします。<br>
・飲料水としてだけではなく、<br>
コーヒー・お茶・水割り・炊飯・調理などにもお使いいただけます。
<br><br>
あづみ野湧水をおすすめする理由<br>
・非加熱製法-加熱処理をせずミクロフィルタだけの直接ボトリング。<br>
天然の風味をそのまま楽しめます。<br>
あづみ野湧水<br>
<br>
栄養成分（100ml当たり）<br>
エネルギー　0<br>
たんぱく質　0<br>
脂質　　　　0<br>
炭水化物　　0<br>
ナトリウム　0.40mg<br>
カリウム　　0.10mg<br>
カルシウム　0.50mg<br>
マグネシウム0.04mg<br>
硬度：14mg/L（軟水）<br>
PH：6.9<br>
<br>

