<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;防災グッズ&nbsp;&gt;&nbsp;水・ミネラルウォーター

北アルプスに降った雪や雨が地中深く染み込み、<br>
長い時間をかけて伏流水となって安曇野に豊かに湧水します。<br>
「北アルプス安曇野のやさし水」は、<br>
この恵豊かな天然水を上質な水源より採水し、<br>
ミクロフィルターでろ過除菌する非加熱製法にて充填しています。<br>
余計な手を加えない為、自然本来のほんのり甘みのある、<br>
やさしい味わいをお楽しみ頂けます。<br>
やさし水<br>
<br>
栄養成分（100ml当たり）<br>
エネルギー　0<br>
たんぱく質　0<br>
